export function add22(a: number, b: number): number {
  return a + b;
}

export function subtract22(a: number, b: number): number {
  return a - b;
}

export function multiply22(a: number, b: number): number {
  return a * b;
}

export function divide22(a: number, b: number): number {
  return a / b;
}
